// frontend/src/pages/UserDashboard.jsx

import React from 'react';
import StatCard from '@/components/StatCard';

const UserDashboard = () => {
  return (
    <div className="p-6 space-y-6">
      <h1 className="text-2xl font-bold text-gray-800">Welcome to your Dashboard</h1>

      <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-6">
        <StatCard title="Submitted Forms" value={1243} />
        <StatCard title="CAPTCHA Failures" value={27} />
        <StatCard title="Websites w/o Forms" value={134} />
      </div>

      <div className="mt-10 text-gray-600">
        <p className="text-lg">Need help? Check the settings page or reach out via our support page.</p>
      </div>
    </div>
  );
};

export default UserDashboard;
